def reversCom(string):
    revString = string[::-1]
    comString = []
    for char in revString:
        if char == 'A':
            comString.append("T")
        elif char == 'T':
            comString.append("A")
        elif char == 'C':
            comString.append("G")
        else:
            comString.append("C")
    str_comString = ''.join(comString)
    return str_comString

def matchString(pattern,string):
    revPattern = reversCom(pattern)
    testLength = len(pattern)
    posList = []
    for i in range (0,len(string)):
        testString = string[i:(i+testLength)]
        if testString == pattern:
            posList.append(i)
        #elif testString == revPattern:
            #posList.append(i)
    posListString = ' '.join(str(x) for x in posList)
    return posListString

